import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Form, Button, Container, Col, Row } from 'react-bootstrap';
import Logo from "../assets/images/logo.png"; // Make sure the path is correct
import BackgroundImage from "../assets/images/background.png";
import "./RegisterForm.css";

const RegistrationPage = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    age: '',
    gender: '',
    email: '',
    userId: '',
    password: '',
    favoriteSports: [],
    termsAgreed: false
  });



  const handleChange = (e) => {
    const { name, value, type, checked  } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleMultiSelectChange = (e) => {
    const values = Array.from(e.target.selectedOptions, option => option.value);
    setFormData(prevState => ({
      ...prevState,
      favoriteSports: values
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Ensure terms are agreed before submitting
    if (!formData.termsAgreed) {
      alert("You must agree to the terms of service.");
      return;
    }
    console.log(formData);
    // Submission logic here
  };

  return (
    <div
      className="register__wrapper"
      style={{ backgroundImage: `url(${BackgroundImage})` }}
    >
      <div>
        <Container>
          <Row className="justify-content-md-center">
            <Col md={6}>
              <Form className="shadow p-4 bg-white rounded" onSubmit={handleSubmit}>
                <img className="img-thumbnail mx-auto d-block mb-2" src={Logo} alt="logo" />
                <h2 className="h4 mb-2 text-center">Register</h2>
                <Form.Group className="mb-3">
                  <Form.Label>First Name</Form.Label>
                  <Form.Control
                    type="text"
                    name="firstName"
                    required
                    onChange={handleChange}
                  />
                </Form.Group>

                <Form.Group className="mb-2">
                  <Form.Label>Last Name</Form.Label>
                  <Form.Control
                    type="text"
                    name="lastName"
                    required
                    onChange={handleChange}
                  />
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>Age</Form.Label>
                  <Form.Control
                    type="number"
                    name="age"
                    required
                    onChange={handleChange}
                  />
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>Gender</Form.Label>
                  <Form.Select name="gender" required onChange={handleChange}>
                    <option value="">Select...</option>
                    <option value="male">Male</option>
                    <option value="female">Female</option>
                    <option value="other">Other</option>
                  </Form.Select>
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>Email</Form.Label>
                  <Form.Control
                    type="email"
                    name="email"
                    required
                    onChange={handleChange}
                  />
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>User ID</Form.Label>
                  <Form.Control
                    type="text"
                    name="userId"
                    required
                    onChange={handleChange}
                  />
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>Password</Form.Label>
                  <Form.Control
                    type="password"
                    name="password"
                    required
                    onChange={handleChange}
                  />
                </Form.Group>

                <Form.Group className="mb-3">
                  <Form.Label>Favorite Sports</Form.Label>
                  <Form.Select multiple name="favoriteSports" onChange={handleMultiSelectChange}>
                    <option value="soccer">Soccer</option>
                    <option value="basketball">Basketball</option>
                    <option value="baseball">Baseball</option>
                    <option value="tennis">Tennis</option>
                    <option value="cricket">Cricket</option>
                  </Form.Select>
                </Form.Group>
                {/* Terms of Service Checkbox */}
                <Form.Group className="mb-3" controlId="formBasicCheckbox">
                  <Form.Check 
                    type="checkbox" 
                    label="I agree to all statements in Terms of Service" 
                    name="termsAgreed"
                    onChange={handleChange} 
                    required
                  />
                </Form.Group>
                <Button variant="primary" type="submit" className="w-100">
                  Register
                </Button>
                  {/* Already have an account */}
                <div className="mt-3">
                  <span>Have an account already? <Link to="/login">Login here</Link></span>
                </div>
              </Form>
            </Col>
          </Row>
        </Container>
        <div className="w-100 mb-2 position-absolute bottom-0 start-50 translate-middle-x text-white text-center">
          Made by Team 17 | &copy;2024
        </div>
      </div>
    </div>
  );
};

export default RegistrationPage;
